INSERT INTO `blog` (`id`, `author`, `title`, `description`) VALUES
(1, 'Dion', 'Your next bowl of spicy noodles', 'Satế is a Vietnamese chili oil made with shallots, garlic, lemongrass, and chilis. We always have a jar of satế in the fridge and the other day I whipped up this super easy barely an inconvenience pasta that was out of my mind good.<br />\r\n<br />\r\nThe luxuriousness of the butter with the spiciness and herbaceousness of the chili oil was so good I could have just slurped it up with a spoon. Add in some chewy toothsome noodles for the sauce to cling to and a hit of freshness from herbs and you have the perfect weeknight spicy noodles recipe!'),
(2, 'Dion', 'Japanese milk bread', 'This is the bread I want to live in. I want to curl up in a squish bread sleeping bag and just day dream all day about toast and toast toppings. I’m pretty sure I’ve said this before, but opening a toast cafe would be my ultimate dream. In my toast cafe I would sell toast (of course) but I would also sell loaves and loaves of this fabulously fluffy bread.<br />\r\n<br />\r\nThere’s just something so comforting about milk bread, aka Japanese shokupan. Is its satisfying squishiness? The fact that it’s elevated to another level in Japan? Or is it just the fact that I love soft white bread and milk bread is the ultimate version? I may never know the answer and I’m okay with it because I am happy forever eating and searching for the perfect milk bread recipe.'),
(3, 'Dion', 'Naan Bread', 'I love naan bread – it’s the best accompaniment to Indian curries or stews. And, if I’m being honest, it’s absolutely perfect even on it’s own, especially if you’ve taken the time to make it yourself.');

