INSERT INTO `recipe_details` (`id`, `step_count`, `step_detail`, `image`) VALUES
(1, 1, 'Crack the eggs into a bowl. Add 1 tsp. milk or cream, water or broth per egg for flavor and richness. Season the eggs with a pinch of salt and pepper. Beat the eggs to blend using a fork or whisk.', ),
(1, 2, 'Coat a nonstick skillet with cooking spray. Place the skillet on the stove over medium heat. Add ½ tsp. butter per egg to the skillet. Pour the eggs into the skillet when the butter melts. Use a flexible heat-proof spatula to push the eggs from one side of the pan to the other. Let the liquid egg flow into the space created by the spatula.', );
INSERT INTO `recipe_details` (`id`, `step_count`, `step_detail`, `image`) VALUES
(1, 3, 'Cook and stir the eggs just until they’re just set then remove the pan from the burner. The eggs will still look slightly moist on top but that is okay—they will continue cooking from the carryover heat in the skillet.', ),
(2, 1, '1 cup + 2 tablespoons, to 1 1/4 cups lukewarm water*\r\n1 heaping tablespoon honey\r\n2 1/4 teaspoons instant yeast\r\n1 3/4 teaspoons salt\r\n2 tablespoons soft butter\r\n4 cups King Arthur Unbleached All-Purpose Flour\r\n1/3 cup Baker’s Special Dry Milk or 1/2 cup nonfat dry milk granules', );
INSERT INTO `recipe_details` (`id`, `step_count`, `step_detail`, `image`) VALUES
(2, 2, 'Mixing can be performed by hand using a large spoon, your hands or a dough whisk; or by machine, using a bread machine, stand mixer, or food processor. Mixing has three purposes: to distribute the ingredients, develop the gluten, and initiate fermentation.\r\n\r\nFor the classic sandwich bread, mix all of the ingredients in the order listed to make a smooth dough. You can use a dough whisk, large spoon, or a mixer to mix the ingredients until are thoroughly incorporated.', );
INSERT INTO `recipe_details` (`id`, `step_count`, `step_detail`, `image`) VALUES
(2, 3, 'To ferment the classic white sandwich bread dough, place it in a lightly greased bowl, or large (8-cup) measuring cup.\r\n\r\nCover it, and let it rise for 60 to 90 minutes.  It should be quite puffy, though not necessarily doubled in size.', );
INSERT INTO `recipe_details` (`id`, `step_count`, `step_detail`, `image`) VALUES
(2, 4, 'Punching down is also called degassing. This is when the dough begins to enter its secondary fermentation.\r\n\r\nGently deflate the dough by removing it from the bowl to the counter.', );
INSERT INTO `recipe_details` (`id`, `step_count`, `step_detail`, `image`) VALUES
(2, 5, 'Benching is where you allow the dough to rest before shaping. The purpose of this stage is to relax the gluten so that it will be easier to handle during the final shaping.\r\n\r\nWe don’t really need to do that for this bread because this dough is easy to work with. We’ll just flatten the dough into a rectangle and then complete the shaping process. The rectangle should be about 5 inches wide and 6 to 8 inches long. This is a large loaf so my measurements are a little wider and longer.', );
INSERT INTO `recipe_details` (`id`, `step_count`, `step_detail`, `image`) VALUES
(2, 6, 'Preheat the oven to 350 degrees. Bake the loaf for 20 minutes. Check the loaf, then bake for an additional 15-20 minutes, until golden brown', );
INSERT INTO `recipe_details` (`id`, `step_count`, `step_detail`, `image`) VALUES
(3, 1, 'Start with a very large pot of water, about 6 quarts per pound of pasta. Bring it to a rapid boil. Tip: A pound of pasta feeds about 5 to 6 people.', );
INSERT INTO `recipe_details` (`id`, `step_count`, `step_detail`, `image`) VALUES
(3, 2, 'Put in a lot of salt, about 3 tablespoons. If you taste the water, it should taste like the sea.', );
INSERT INTO `recipe_details` (`id`, `step_count`, `step_detail`, `image`) VALUES
(3, 3, 'Drop in the pasta while the water is at a boil and give it a gentle stir.', );
INSERT INTO `recipe_details` (`id`, `step_count`, `step_detail`, `image`) VALUES
(3, 5, 'Add the pasta to your sauce and finish cooking it in the sauce. Give it a stir to coat.', );
INSERT INTO `recipe_details` (`id`, `step_count`, `step_detail`, `image`) VALUES
(4, 1, 'Start with a very large pot of water, about 6 quarts per pound of pasta. Bring it to a rapid boil. Tip: A pound of pasta feeds about 5 to 6 people.', );
INSERT INTO `recipe_details` (`id`, `step_count`, `step_detail`, `image`) VALUES
(4, 2, 'Put in a lot of salt, about 3 tablespoons. If you taste the water, it should taste like the sea.', );
INSERT INTO `recipe_details` (`id`, `step_count`, `step_detail`, `image`) VALUES
(4, 3, 'Drop in the pasta while the water is at a boil and give it a gentle stir.\r\n\r\nStir it occasionally while it cooks. Use the cooking time on the pasta package as a guide.', );

